function removeItemOnce(arr, value) {
  var index = arr.indexOf(value);
  if (index > -1) {
    arr.splice(index, 1);
  }
  return arr;
}

function removeItemAll(arr, value) {
  var i = 0;
  while (i < arr.length) {
    if (arr[i] === value) {
      arr.splice(i, 1);
    } else {
      ++i;
    }
  }
  return arr;
}
let mention = (name) => {
  return `@${name.replace(" ", "_")}`;
};

let playerdata = new Map();
function _onPlayerJoin(p) {
  let { auth, id, conn, name } = p;
  function decryptHex(str) {
    let hexString = str;
    let strOut = "";
    for (let x = 0; x < hexString.length; x += 2) {
      strOut += String.fromCharCode(parseInt(hexString.substr(x, 2), 16));
    }
    return strOut;
  }
  function addPlayerData() {
    let playerData = {
      IPv4Addr: decryptHex(conn),
      id: String(id),
      name: String(name),
      auth: String(auth),
    };
    playerdata.set(id, playerData);
  }
  function welcomeMsg() {
    return duyuru(`${name},hos geldin`);
  }
  setPlayerTeam(id, teams.red);
  addPlayerData();
  welcomeMsg();
}
function _onPlayerChat(p, m) {
  let { admin, id, name } = p;
  function mesajKufurIceriyor() {
    let kufurlerr = /(amk|aq|awq|amq|mk)/gim;
    return kufurlerr.test(m);
  }
  if (mesajKufurIceriyor()) {
    let auth = playerdata.get(id);
    if (!uyarilar.has(auth) || uyarilar.get(auth) == 0) {
      uyarilar.set(auth, 1);
      return duyuru("Ilk uyarini aldin! Konusmalarina dikkat et!", id);
    }
    let deger = Number(uyarilar.get(auth));
    deger += 1;
    uyarilar.set(auth, deger);
    if (uyarilar.get(auth) == 3) {
      kick(id, "3 defa uyardik ama hala akillanmiyorsun!", true);
      uyarilar.set(auth, 0);
      return;
    }
  }
  function setPassword() {
    if (!admin)
      return duyuru(
        "Bu komutu kullanabilmeniz icin admin olmaniz gerekmektedir! " +
          mention(name),
        id
      );
    if (randompass == null) {
      randompass = String(Math.floor(Math.random() * 10000));
      room.setPassword(randompass);
      duyuru("Odanin sifresi degistirildi", null);
    } else {
      randompass = null;
      room.setPassword(randompass);
      duyuru("Odanin sifresi sifirlandi!", null);
    }
  }
  function Pass() {
    if (!admin)
      return "Bu komutu kullanabilmeniz icin admin olmaniz gerekmektedir.";
    return randompass == null
      ? "Odanin sifresi yok!"
      : "Odanin sifresi: " + randompass;
  }
  function getUserInfo() {
    let data;
    let idregex = /#\d+/g;
    if (idregex.test(m)) {
      if (!admin)
        return duyuru(
          "Baska birisinin bilgilerini gorebilmek icin admin olmaniz gerekmektedir :)",
          id
        );
      let ids = m.match(idregex);
      ids.forEach((e) => {
        e = Number(e.replace("#", ""));
        data = playerdata.get(e);
        duyuru(
          `${e} idli kullanicinin bilgileri:
IPv4: ${data.IPv4Addr}
Auth: ${data.auth}`,
          id
        );
      });
    } else {
      data = playerdata.get(id);
      duyuru(
        `${name}, iste bilgileriniz:
IPv4: ${data.IPv4Addr}
Auth: ${data.auth}
ID: ${id}`,
        id
      );
    }
  }
  if (m.startsWith("!pass")) {
    setPassword();
  }
  if (m.startsWith("?pass")) {
    duyuru(Pass(), id);
  }
  if (m.startsWith("!info")) {
    getUserInfo();
  }
}

